import React from 'react';
import links from './headerLinks';

import {
    Nav, 
    NavItem
} from './styled';

const HeaderComponent = () => {
    return (
        <Nav>
            {links.map((index, link) => (
                <NavItem 
                    key={link.name}
                    to={link.route}
                >
                    link.name
                </NavItem>
            ))}
        </Nav>
    )
};

export default HeaderComponent;
